 * Increments the given state by 1.
 * @param previousState The state to be incremented
 * @returns The incremented state
 */
async function increment(previousState:number): Promise<number> {
  return previousState + 1;
}

/**
 * decrements the taken state by 1.
 * @param previousState The state to be decremented
 * @returns The decremented state
 */

async function decrement(previousState:number): Promise<number> {
  return previousState - 1;
}

